@Test
  public void prependTo_prependsProperSql() {
    /* Given */
    DropImpl drop = new DropImpl();
    RawSqlBuilder builder = new RawSqlBuilderImpl();

    /* When */
    drop.prependTo(builder);

    /* Then */
    assertThat(builder.toString(), is("DROP"));
  }

